INSERT INTO `product_review_summaries` VALUES (297,'2025-06-19 11:46:03.687257','2025-06-19 11:46:03.687257',3,12,'메가MGC커피 아메리카노 HOT 2잔 혜택이 좋고, 맛과 향이 만족스럽다는 의견이 많습니다. 가성비가 뛰어나고 쿠폰 사용이 간편하며, 매장 분위기도 좋다고 평가받았습니다.',3,'속도가 느리다는 불만이 있으며, 가격은 저렴하지만 서비스 품질에 대한 불만이 있습니다. 사용 경험에 대한 만족도가 낮은 편입니다.',2,1,'COUPON','2025-06-19',17),(298,'2025-06-19 11:46:03.687257','2025-06-19 11:46:03.687257',3.5,9,'데이터가 넉넉하고 속도도 빠르며, 친절한 고객센터에 감동받은 고객들이 많습니다. 통화 품질이 좋지 않은 부분을 제외하면 대체로 만족하는 리뷰가 많이 있습니다.',8,'속도는 괜찮지만 데이터 부족을 불만으로 여기는 의견이 있고, 일부 고객은 그럭저럭 사용할 만하다는 평가를 내리고 있습니다.',5,2,'PLAN','2025-06-19',22),(299,'2025-06-19 11:46:03.687257','2025-06-19 11:46:03.687257',3.5,6,'지니뮤직을 통한 음악 감상이 편리하고, 음질이 좋으며 가성비가 좋다는 긍정적인 의견이 많습니다.',5,'지니뮤직의 가격 경쟁력과 할인 부족으로 인해 비싼 가격을 불만으로 여기는 리뷰가 많이 있습니다.',5,2,'VAS','2025-06-19',16),(300,'2025-06-19 11:46:05.196687','2025-06-19 11:46:05.196687',3,1,'지니뮤직 음질이 좋다는 긍정적인 의견이 있으나 가끔 끊김이 발생한다는 언급이 있습니다.',5,'지니뮤직 100곡 듣기로 음악 감상이 좋다는 의견이 있으나 특색이 부족하다는 의견이 있습니다.',6,3,'VAS','2025-06-19',12),(301,'2025-06-19 11:46:05.794741','2025-06-19 11:46:05.794741',3.5,4,'친절한 고객센터와 다양한 프로모션으로 고객들에게 좋은 인상을 줍니다. 어르신들도 편하게 이용할 수 있어서 만족스러운 서비스입니다.',11,'통화 품질과 특색이 부족하다는 의견이 있으며, 데이터 소진 속도가 빠르다는 불만이 있습니다. 서비스센터 응대에 대한 아쉬움도 표현되었습니다.',2,3,'PLAN','2025-06-19',17),(302,'2025-06-19 11:46:06.193521','2025-06-19 11:46:06.193521',3,11,'배스킨라빈스 파인트 4천원 할인 혜택을 통해 가족들이 신선하고 다양한 아이스크림을 즐기며 모임을 즐기는 모습이 많이 언급됩니다. 새로운 맛을 부담 없이 시도할 수 있어 만족도가 높은 편입니다.',5,'쿠폰 혜택에 대한 특별한 언급이 없으며, 전반적으로 특색이 부족하다는 의견이 있습니다. 서비스센터 응대에 대한 부정적인 평가도 있지만, 쿠폰 혜택에 대한 리뷰는 부족합니다.',4,2,'COUPON','2025-06-19',20),(303,'2025-06-19 11:46:07.978472','2025-06-19 11:46:07.978472',3.5,7,'데이터 용량이 넉넉하고 속도도 빠르다는 긍정적인 의견이 많습니다. 어르신들도 쉽게 사용할 수 있어 만족도가 높은 요금제입니다.',9,'속도가 자주 느려지고 고객센터 응대가 아쉬웠던 부분이 많이 언급되었습니다. 또한 통화 품질은 좋지만 요금이 높다는 부정적인 의견도 있습니다.',5,4,'PLAN','2025-06-19',21),(304,'2025-06-19 11:46:08.459376','2025-06-19 11:46:08.459376',3,7,'파리바게뜨 할인쿠폰을 여러 번 사용할 수 있어 좋아하는 의견과 친절한 고객센터에 감동한 이야기가 많습니다. 어르신도 편하게 사용할 수 있는 점이 좋아하는 고객들이 있습니다.',3,'고객들 중에는 최악이라고 평가하며 다시는 사용하지 않겠다는 의견이 있습니다. 일부는 그럭저럭 사용할만하다는 평가를 내리지만, 특별한 만족을 주는 부분은 없는 것으로 보입니다.',9,3,'COUPON','2025-06-19',19),(305,'2025-06-19 11:46:08.913375','2025-06-19 11:46:08.913375',3,3,'유튜브 프리미엄 광고 없이 영상을 잘 시청할 수 있어서 매우 좋아하는 고객들이 많습니다. 영상 재생이 끊김 없이 원활하게 이루어져 만족하는 표현이 많이 보입니다.',8,'일부 고객들은 가끔씩 버퍼링이 발생하여 서비스 품질에 불만을 표현하고 있습니다. 또한 일부는 유튜브 프리미엄 서비스의 가성비에 대해 만족스럽지 않다는 의견을 제시하고 있습니다.',2,4,'VAS','2025-06-19',13),(306,'2025-06-19 11:46:10.817374','2025-06-19 11:46:10.817374',3,5,'디즈니+의 사용법이 간단하고 편리하며, 픽사 애니메이션 화질이 좋다는 긍정적인 의견이 많습니다.',4,'고객들은 디즈니+ 콘텐츠 다양성과 고객 서비스에 대해 아쉬움을 표현했습니다.',5,6,'VAS','2025-06-19',14),(307,'2025-06-19 11:46:11.166374','2025-06-19 11:46:11.166374',3,9,'문자와 통화가 무제한이라 가족들에게 만족스러운 요금제입니다. 프로모션 혜택이 풍부하고 데이터 소진이 빠르다는 의견이 있지만 전반적으로 대체로 만족하는 편입니다.',5,'통화 품질이 좋지 않아 아쉬운 부분이 있으며, 안정적이지만 특별한 혜택이 부족하다는 의견이 있습니다. 어르신들이 사용하기에 편리하다는 긍정적인 평가가 있지만 전반적으로 무난한 수준으로 평가받고 있습니다.',3,5,'PLAN','2025-06-19',17),(308,'2025-06-19 11:46:11.358374','2025-06-19 11:46:11.358374',3,11,'리디셀렉트 전자책 무제한구독권으로 독서량이 늘어나고, 다양한 장르의 책을 즐길 수 있어 많은 고객들이 만족하고 있습니다. 또한 출퇴근길이나 자기계발 시간에 유용하게 활용되는 점이 좋아요.',1,'특색이 부족하다는 의견이 있으며, 가격은 저렴하지만 속도가 느리다는 부정적인 평가가 있습니다.',1,4,'COUPON','2025-06-19',13),(309,'2025-06-19 11:46:12.488443','2025-06-19 11:46:12.489444',3.5,4,'해외에서도 잘 터지며 유용한 데이터와 빠른 속도로 매우 만족하는 고객들이 많습니다.',4,'데이터 소진이 빠르고 속도가 느려 사용이 불편한 의견이 있습니다.',3,6,'PLAN','2025-06-19',11),(310,'2025-06-19 11:46:13.594043','2025-06-19 11:46:13.594043',3,15,'카카오페이지 캐시로 웹툰과 소설을 편하게 즐기는 것을 좋아하는 고객들이 많으며, 결제가 편리하고 작가들을 응원할 수 있는 혜택으로 인해 의미를 느끼는 고객들이 많습니다.',4,'쓰기 편한 점은 양호하지만 가격 대비 속도가 느리다는 불만이 있으며, 서비스센터 응대에 대한 부정적인 경험으로 인해 사용에 제약을 느끼는 고객들이 있습니다.',4,5,'COUPON','2025-06-19',23),(311,'2025-06-19 11:46:13.697043','2025-06-19 11:46:13.697043',3,6,'넷플릭스와 디즈니+ 부가서비스에 대한 다양한 콘텐츠와 친절한 고객센터에 대한 긍정적 의견이 많습니다. 무제한 시청 혜택을 강조하는 리뷰들도 있습니다.',3,'안정성에 대한 불만이 있으며, 무제한 시청 혜택을 강조하는 리뷰들이 부정적으로 언급되었습니다.',0,7,'VAS','2025-06-19',9),(312,'2025-06-19 11:46:14.854053','2025-06-19 11:46:14.854053',3.5,9,'데이터 용량이 넉넉하고, 가성비가 좋다는 긍정적인 의견이 많습니다. 또한 편리한 어르신 사용성과 만족스러